// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import './CoinToken.sol';

contract CoinTokenFactory {
    address[] public tokenContracts;

    function createCoinToken(
        string memory name,
        string memory symbol,
        uint256 decimals,
        uint256 supply,
        uint256 txFee,
        uint256 lpFee,
        uint256 dexFee,
        address routerAddress,
        address feeAddress,
        address tokenOwner,
        address service
    ) external {
        CoinToken newToken = new CoinToken(
            name,
            symbol,
            decimals,
            supply,
            txFee,
            lpFee,
            dexFee,
            routerAddress,
            feeAddress,
            tokenOwner,
            service
        );
        tokenContracts.push(address(newToken));
    }
}
